import React from 'react';
import { Outlet } from 'react-router-dom';
import Header from '../common/Header';
import Navbar from '../common/Navbar';
import Footer from '../common/Footer';

const AdminLayout = () => {
    return (
        <div>
            <Header />
            <Navbar />
            <main>
                <Outlet />
            </main>
            <Footer />
        </div>
    );
};

export default AdminLayout;
